Earth Under Water

Science Documentary hosted by Philip Bretherton, published by BBC in 2010 - English narration


Information
------------------------------

Based on research by NASA astro-biologist and
paleontologist Professor Peter Ward and a group of
respected American climatologists, this eye-opening
documentary uses scientific evidence past and present,
archive film, location photography and CGI to explore
the dire consequences should the atmosphere's CO2
levels treble over the next 100-300 years, as predicted.

